import $ from 'jquery';

export async function loadPosts() {
    return fetch('https://vibin-backend.herokuapp.com/api/posts', {
        headers: {
            'Access-Control-Allow-Origin': '*',
            'Content-Type': 'application/x-www-form-urlencoded'
        },
        method: 'GET',
    }).then(d => d.json());
}

export async function submitPost(name, text, songId, songName, songArtist, startTime, stopTime) {
    var data = new URLSearchParams();
    data.append('name', name);
    data.append('text', text);
    data.append('songId', songId);
    data.append('songName', songName);
    data.append('songArtist', songArtist);
    data.append('startTime', startTime);
    data.append('stopTime', stopTime);
    return fetch('http://vibin-backend.herokuapp.com/api/newPost', {
        method: 'POST',
        headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
        body: data
    });
}
